import Navbar from './Component/Navbar';
import Footer from './Component/Footer';
import Carousels from './Component/Carousels';
import MainPage from './Component/Front/MainPage/MainPage';
import {ProductType} from './Redux/Reducer';
import Product from './Component/Front/Products/ProductLayout';
import Covid from './Component/Front/Covid-19/CovidLayout';

function App() {
  return (
    <div>
      <ProductType>
        <Router>
          <Navbar />
          <Carousels />
          <Switch>
            <Route path="/" exact component={MainPage}></Route>
            <Route path="/product" exact component={Product}></Route>
            <Route path="/covid-19" exact component={Covid}></Route>
